  input: TEXT,"F3XA","","This amendment is in response to your letter of March 14,
    2007.  Schedule A has been amended to correct the erroneous report of a payment
    by the AFL-CIO to the Committee.  In fact, this was a transfer by an affiliated
    political committee that was being terminated in accordance with the commission's
    rules.  We have added the name of our Treasurer to each page of Schedule E supporting
    Line 24.  Please note, however, that the electronic signature provided on the
    cover page of every electronically filed report itself serves as a statement that
    all data within is true and accurate according to the best available data at the
    time the report is filed.  Because the same Schedule E is also used separately
    as a 24 or 48 hour report as needed throughout a given election period, it is
    then that the requirement to electronically sign each page is required because
    there would otherwise be no such commitment shown to the public in a cover page.  The
    independent expenditures that were reported on Schedule E concern only costs attributable
    to the AFL-CIO's publicly accessible website, which included references, endorsements
    and other express advocacy and non-express advocacy concerning dozens if not hundreds
    of candidates for the House and the Senate, and which were posted and removed
    at various times during the reporting period.  No disbursements with respect to
    any particular race could be calculated to implicate the $1,000 threshold for
    24 hour reporting, and it would be both practially arduous and uninformative to
    try to list and itemize all of these expenditures by candiate or race given the
